import React, {useRef} from 'react'

import spaceship1 from '../img/spaceship.png'
import spaceship2 from '../img/spaceship2.png'
import spaceship3 from '../img/spaceship3.png'
import spaceship4 from '../img/spaceship4.png'

export default function Images(){

    const spaceshipRef = useRef('spaceship');

    return(
        <div className="images">
            {false &&
                <img src={spaceship1} alt="spaceship" ref={this.spaceshipRef}/>
            }
        </div>
    )

}
